the workout;
1️⃣ sumo deadlifts 5x6
- went reaallyy light yesterday because i haven’t done this in awhile and i really wanted to improve my form. 

2️⃣ smith machine hip thrusts 4x12
you can use a barbell for this, but i personally prefer the smith machine just because it’s easier to set up🙊

3️⃣ reverse lunges 4x12
* for extra ROM, you can use a step for the stationary leg. i don’t lock out my knees fully so as to keep the tension

4️⃣ lying hamstring curls 3x15
- one of my favourite exercises for targeting the hamstrings! try not to lock out all the way for constant tension

5️⃣ cable RDL 3x15

6️⃣ side abductions 3x20

7️⃣ hip abductions (upright) 3x25
- i forgot to set the machine to the closest point so it looks like im not doing full reps🥵
- this exercise is really good for targeting the glutes as a burnout set! 🥰

ion. \n\n#02 Be a Persistent and Consistent Workout Partner\n\nAs all relationships are, being a workout partner to your friend(s) is a two way traffic too. When you show that you are persistent and consistent it will motivate your buddy to do so as well. And in turn it will help you someday, what goes around always come around. Empathy is key here, try to see things from their perspective and break them in gently.\n\nWe have two more tips for you and we will be sharing them in the next Fact Friday. So do follow us for the next GYMMBOXX Fact Friday! \n\n#GYMMBOXXFactFriday\n#GYMMBOXX\n#GYMMBOXXBedokPoint\n#GYMMBOXXCenturySquare\n#GYMMBOXXBishan\n#GYMMBOXXKebunBaru\n#GYMMBOXXJCube\n#GYMMBOXXKeatHong\n#GYMMBOXXCanberra\n#SupportLocal\n#StayHealthy\n\nCitations:\n4 Fitness Motivation Hacks for Friends. (2021). Retrieved January 22, 2021, from https://www.healthhub.sg/live-healthy/1008/6-ways-to-motivate-your-loved-ones-to-exercise"}}]},"edge_media_to_comment":{"count":0},"comments_disabled":false,"taken_at_timestamp":1611311582,"edge_liked_by":{"count":51},"edge_media_preview_like":{"count":-1},"location":null,"thumbnail_src":"https://instagram.fsin2-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c1.0.1438.1438a/s640x640/140581715_219886063148679_4934966403865655218_n.jpg?_nc_ht=instagram.fsin2-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=xpQvJmD1NvsAX9xuaAh\u0026tp=1\u0026oh=6d12379f8a4870aaf65ece48403eeb26\u0026oe=60412C13","thumbnail_resources":[{"src":"https://instagram.fsin2-1.fna.fbcdn.net/v/t51.2885-15/e35/c1.0.1438.1438a/s150x150/140581715_219886063148679_4934966403865655218_n.jpg?_nc_ht=instagram.fsin2-1.fna.fbcdn.net\u0026_nc_cat=103\u0026_nc_ohc=xpQvJmD1NvsAX9xuaAh\u0026tp=1\u0026oh=6e50bbec46af84f09d6157c7fe36fab6\u0026oe=6040CAD6","config_width":150,"config_height":150},{"src":"https://instagram.fsin2-1.fna.fbcdn.net/v/t51.2885-15/e35/c1.0.1438.1438a/s240x240/140581715_219886063148679_4934966403865655218_n.jpg?_nc_ht=instagram.fsin2-1.fna.fbcdn.net\u0026_nc_cat ercising, you should take it down a notch.\n\n#03 Seek Regular Prenatal Care\n\nVisiting your doctor often will ensure that any issues can be handled early. It will also help reassure you that you're doing well during your pregnancy.\n\n#04 Give Up Unhealthy Habits\n\nUnhealthy habits such as smoking and drinking may cause harm to your baby and you. It is best to give up these habits.\n\nKeep our tips in mind to help better manage your pregnancy!\n\nFollow us for more GYMMBOXX Fact Friday! Till next time. Stay active, stay healthy! \n\n#GYMMBOXXFactFriday\n#GYMMBOXX\n#GYMMBOXXBedokPoint\n#GYMMBOXXCenturySquare\n#GYMMBOXXBishan\n#GYMMBOXXKebunBaru\n#GYMMBOXXJCube\n#GYMMBOXXKeatHong\n#GYMMBOXXCanberra\n#SupportLocal\n#StayHealthy\n\nCitations:\n4 Habits to Manage Your Weight if You're Plus Sized. (2020, July). Retrieved December 18, 2020, from https://www.healthhub.sg/live-healthy/1680/4-habits-to-manage-your-weight-if-youre-plus-sized"}}]},"edge_media_to_comment":{"count":0},"comments_disabled":false,"taken_at_timestamp":1608282938,"edge_liked_by":{"count":55},"edge_media_preview_like":{"count":-1},"location":null,"thumbnail_src":"https://instagram.fsin2-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c1.0.1438.1438a/s640x640/131928112_242220370586968_9194887158363211314_n.jpg?_nc_ht=instagram.fsin2-1.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=90NnZDTSYYwAX9VQtcI\u0026tp=1\u0026oh=fd2c64212d88938c3d9a88647e601f62\u0026oe=603F539A","thumbnail_resources":[{"src":"https://instagram.fsin2-1.fna.fbcdn.net/v/t51.2885-15/e35/c1.0.1438.1438a/s150x150/131928112_242220370586968_9194887158363211314_n.jpg?_nc_ht=instagram.fsin2-1.fna.fbcdn.net\u0026_nc_cat=104\u0026_nc_ohc=90NnZDTSYYwAX9VQtcI\u0026tp=1\u0026oh=16970cf2d87671c44b7d48bb0e451e07\u0026oe=603FAA5F","config_width":150,"config_height":150},{"src":"https://instagram.fsin2-1.fna.fbcdn.net/v/t51.2885-15/e35/c1.0.1438.1438a/s240x240/131928112_242220370586968_9194887158363211314_n.jpg?_nc_ht=instagram.fsin2-1.fna.fbcdn.net\u0026_
